import EmpIng from "../../assets/employeeimg.webp";
function Home() {
  return (
    <div className="container mt-5 d-flex flex-column align-items-center justify-content-center">
      <img src={EmpIng} alt="Description of image" />
    </div>
  )
}

export default Home;
